import React from 'react';
import { motion } from 'framer-motion';

export default function AnimeImages() {
    return (
        <motion.div
            style={{
                display: 'flex',
                justifyContent: 'space-around',
                alignItems: 'center',
                height: '100vh',
                backgroundColor: '#000000',
            }}
        >
            {/* Premier conteneur */}
            <motion.div
                initial={{ y: 200 }}
                animate={{ y: 0 }}
                transition={{
                    duration: 1.5,
                    ease: 'easeInOut',
                }}
                style={{
                    width: '200px',
                    height: '300px',
                    backgroundColor: '#ffffff',
                    borderRadius: '15px',
                    overflow: 'hidden',
                    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                }}
            >
                <img
                    src="https://images6.alphacoders.com/135/1352218.png" // Image de Luffy
                    alt="Luffy"
                    style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                    }}
                />
            </motion.div>

            {/* Deuxième conteneur */}
            <motion.div
                initial={{ y: 200 }}
                animate={{ y: 0 }}
                transition={{
                    duration: 1.5,
                    ease: 'easeInOut',
                    delay: 0.3,
                }}
                style={{
                    width: '200px',
                    height: '300px',
                    backgroundColor: '#ffffff',
                    borderRadius: '15px',
                    overflow: 'hidden',
                    boxShadow: '0 4px 10px rgba(0, 0, 0, 0.2)',
                }}
            >
                <img
                    src="https://images2.alphacoders.com/136/1369365.jpeg" // Image de Zoro
                    alt="Zoro"
                    style={{
                        width: '100%',
                        height: '100%',
                        objectFit: 'cover',
                    }}
                />
            </motion.div>

            <motion.footer
                id="contact"
                style={{
                    height: '60px',
                    display: 'flex',
                    justifyContent: 'center',
                    alignItems: 'center',
                    backgroundColor: '#222',
                    color: '#fff',
                    fontSize: '16px',
                    boxShadow: '0 -4px 10px rgba(0, 0, 0, 0.2)',
                }}
                initial={{ y: 100 }}
                animate={{ y: 0 }}
                transition={{ duration: 1, ease: 'easeOut' }}
            >
                © 2024 Anime Gallery - Tous droits réservés
            </motion.footer>
        </motion.div>
    );
}
